  [],\n\t\"revision_timestamp\": \"2016-07-27T22:22:16.831254\",\n\t\"name\": \"predator-reduction-to-increase-duck-production-on-islands-at-big-stone-nwr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Big Stone NWR is considering reducing mammalian
  predators from islands in the  east conservation pool by trapping during the waterfowl
  nesting season. Target  species would include red fox, raccoon, striped skunk, mink
  and feral cats. If  predator reduction is successful, determined by continued monitoring
  of nest  success, removal of predators from islands in the west conservation pool
  would  follow. This proposal is one of the strategies identified in Part III of
  the approved Predator-Habitat Management Plan to Increase Duck Production on Big
  Stone NWR (copy enclosed).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
